




















SELECT
    data,
    EXTRACT(YEAR FROM data)::INT AS ano,
    EXTRACT(MONTH FROM data)::INT AS mes,
    EXTRACT(DAY FROM data)::INT AS dia,
    CASE
        WHEN EXTRACT(MONTH FROM data) IN (1, 2, 3) THEN 1
        WHEN EXTRACT(MONTH FROM data) IN (4, 5, 6) THEN 2
        WHEN EXTRACT(MONTH FROM data) IN (7, 8, 9) THEN 3
        ELSE 4
    END AS trimestre
FROM generate_series('2023-01-01'::DATE, '2024-10-31'::DATE, '1 day'::INTERVAL) AS data
LIMIT 200;

